import React from 'react';
import {View, Text, StyleSheet} from "react-native";

export const Onboard = () => {
    return (
        <View style={styles.container}>
            <Text>Onboard</Text>
        </View>
    );
};


const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',

    },
});
